import React from 'react';
import { Button, Jumbotron, Image, Container } from 'react-bootstrap';
//import cover from '../images/cover.png';
import Link from 'next/link'
//<Image src={cover} alt="Cover Logo" width="80%" />
function Home() {
    return (
        <main>
        <Container fluid="lg">
        </Container>
        <Jumbotron>
        <h1>Hi I'm Andrew Cutlip</h1>
        <p>I am a developer that could work for you.</p>
        <p>I am a computer science student that wants to learn and but his skills to use.</p>
        <p>Feel free to learn more about me</p>
        <p>See some of the work I have done</p>
        <p>Or see what skills I can offer you</p>
        <p>If you like what you see then feel free to contact me</p>
        <Container className="btns">
            <Button as={Link} to="/contact#service" variant="primary" size="lg" className="sectionButton">
                Need a Developer
            </Button>
            <Button as={Link} to="/contact#hire" variant="primary" size="lg" className="sectionButton">
                Hire Me
            </Button>
        </Container>
        </Jumbotron>
        </main>
    )
}

export default Home;
